fragment PageInfoFragment on PageInfo {
  endCursor
  hasNextPage
  hasPreviousPage
  startCursor
  __typename
}

query SearchAvailableAttributes($id: ID!, $after: String, $first: Int!, $query: String!) {
  productType(id: $id) {
    id
    availableAttributes(after: $after, first: $first, filter: {search: $query}) {
      edges {
        node {
          id
          name
          slug
          __typename
        }
        __typename
      }
      pageInfo {
        ...PageInfoFragment
        __typename
      }
      __typename
    }
    __typename
  }
}
